import React from "react";

function Project(props) {
    return (
        <section>
            {props.projects.map(item => {
                if(item.hasApp === true)
                {
                    <div key={item.id}>
                        <h3>{item.name}</h3>
                        <img src={item.photoLink}/>
                        <a href= {item.gitHub} >
                            <img alt="GitHub Logo" src= "https://cdn-icons-png.flaticon.com/512/25/25231.png" width="32px" height="32px"/>
                        </a>
                        <p>{item.description}</p>
                        
                    </div>
                }else{
                    <h1>Not working</h1>
                }
            })}
        </section>
    )
}

export default Project;
